        <label className="input-label">What's you trash-can code?</label>
        <input type="text" className="input-field" />
      </div>
      <style jsx>{`
        .spacer {
          flex: 1;
        }
        .container {
          max-width: 500px;
          padding: 20px;
          margin: auto;
          font-size: 5vh;
        }
        .input-label {
          font-size: 3vh;
        }
      `}</style>
    </>
  );
};

export default Search;
